import React from 'react';

const Report = ({ report }) => {
  return (
    <div>
      <h2>Report</h2>
      {report.length === 0 ? (
        <p>No data available</p>
      ) : (
        report.map((item, index) => (
          <div key={index}>
            <p>English: {item.Word.english}</p>
            <p>Turkish: {item.Word.turkish}</p>
          </div>
        ))
      )}
    </div>
  );
};

export default Report;
